import React from 'react';
import NavBar from '../header';
import { Document, Page } from 'react-pdf';

const resume = () => {
  return (
    <div>
      <NavBar />

      <Document
        file="./WilliamSternResume2021.pdf"
      >
        <Page pageNumber = {1} />
      </Document>
    </div>)
};

export default resume;
